import React from "react";
import headerbg from './Main_info/image/LWL_Campus_2020.png'
import "./App.css";
import {Container} from "reactstrap";


const App = () => (
    <div className="w-responsive text-center  p-3 mt-2">
        <Container>
            <row>
                <col>
                    <img src={{ headerbg }}  />
                </col>
            </row>
        </Container>
    </div>
);




export default App;
